import React from "react";

export default class Card extends React.Component {
    constructor (props) {
        super(props)
        this.card = props.card
    }
    render () {
        return(
                <article className="place" key={this.card._id}>
                    <button className="place__trash"></button>
                    <img className="place__image" style={{ backgroundImage: `url(${card.link})` }}/>
                    <div className="place__info">
                        <h2 className="place__title">${card.name}</h2>
                        <div className="place__like-container">
                        <button className="place__like" type="button"></button>
                        <span className="place__like-counter">{card.likes.length}</span>
                        </div>
                    </div>
                </article>
        )
    }
}
